using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct PlayerLevelComponentResolver : IResolver<PlayerLevelComponent>, IResolver<PlayerLevelComponentResolver,PlayerLevelComponent>, IData	{		[Key(0)]		public int Level;		public PlayerLevelComponentResolver In(ref PlayerLevelComponent playerlevelcomponent)		{			this.Level = playerlevelcomponent.Level;			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<PlayerLevelComponent>();			Out(ref local);		}		public void Out(ref PlayerLevelComponent playerlevelcomponent)		{			playerlevelcomponent.Level = this.Level;		}	}}